function EcoLogo({size=24,color="#fff"}){
  return <svg width={size} height={size} viewBox="0.8 0.8 98.5 98.5" fill="none">
    <path d="M50.1 97.3L2.8 50.1 50.1 2.8 97.3 50 50.1 97.3zM10.7 57.9h63l15.7-15.7M2.8 50.1h63l15.7-15.7m-70.8 7.8h47.2l15.7-15.7m-7.8 55.1H34.3m23.6 7.8H42.2m31.5-15.7H26.4m55.2-7.9h-63m0-31.5h31.5l15.7-15.7m-39.4 7.8h15.7l15.7-15.7" fill="none" stroke={color} strokeWidth="4" strokeMiterlimit="10"/>
  </svg>;
}

function SevBadge({l}){ const c={Critical:{bg:P.green,t:"#fff"},High:{bg:P.greenLight,t:"#fff"},Medium:{bg:P.greenPale,t:P.ink}}[l]||{bg:P.rule,t:P.ink}; return <span style={{display:"inline-block",padding:"2px 10px",borderRadius:2,fontSize:SZ.mono,fontFamily:F.mono,letterSpacing:"0.05em",textTransform:"uppercase",background:c.bg,color:c.t}}>{l}</span>; }
function TypeTag({t}){ const c={foundational:P.green,research:P.greenMid,technical:P.greenLight,applied:P.accent,policy:P.inkMuted}; return <span style={{display:"inline-block",padding:"1px 8px",borderRadius:2,fontSize:SZ.label,fontFamily:F.mono,letterSpacing:"0.06em",textTransform:"uppercase",border:`1px solid ${c[t]||P.rule}`,color:c[t]||P.inkMuted,marginRight:6}}>{t}</span>; }
function StatusDot({s}){ const c={open:P.inkLight,active:P.greenMid,blocked:P.amber}; return <span style={{display:"inline-block",width:8,height:8,borderRadius:"50%",background:c[s]||P.inkLight,marginRight:6,flexShrink:0}} title={s}/>; }
function MTag({name,onNav}){ return <span onClick={e=>{e.stopPropagation();if(onNav)onNav()}} style={{display:"inline-block",fontFamily:F.mono,fontSize:SZ.label,color:P.greenMid,padding:"1px 6px",border:`1px solid ${P.greenMid}33`,borderRadius:2,marginRight:4,marginBottom:3,textDecoration:"none",cursor:"pointer",transition:"all 0.15s"}} onMouseEnter={e=>{e.currentTarget.style.background=P.greenFaint;e.currentTarget.style.borderColor=P.greenMid}} onMouseLeave={e=>{e.currentTarget.style.background="transparent";e.currentTarget.style.borderColor=P.greenMid+"33"}}>{name}</span>; }
function FTag({name,onNav}){ return <span onClick={e=>{e.stopPropagation();if(onNav)onNav()}} style={{display:"inline-block",fontFamily:F.mono,fontSize:SZ.label,color:P.red,padding:"1px 6px",border:`1px solid ${P.red}33`,borderRadius:2,marginRight:4,marginBottom:3,textDecoration:"none",cursor:"pointer",transition:"all 0.15s"}} onMouseEnter={e=>{e.currentTarget.style.background=P.red+"11";e.currentTarget.style.borderColor=P.red}} onMouseLeave={e=>{e.currentTarget.style.background="transparent";e.currentTarget.style.borderColor=P.red+"33"}}>{name}</span>; }
function GTag({name,onNav}){ return <span onClick={e=>{e.stopPropagation();if(onNav)onNav()}} style={{display:"inline-block",fontFamily:F.mono,fontSize:SZ.label,color:P.blue,padding:"1px 6px",border:`1px solid ${P.blue}33`,borderRadius:2,marginRight:4,marginBottom:3,textDecoration:"none",cursor:"pointer",transition:"all 0.15s"}} onMouseEnter={e=>{e.currentTarget.style.background=P.blue+"11";e.currentTarget.style.borderColor=P.blue}} onMouseLeave={e=>{e.currentTarget.style.background="transparent";e.currentTarget.style.borderColor=P.blue+"33"}}>{name}</span>; }

function SectionImage({src,h=160,pos="center",overlay}){
  return <div style={{width:"100%",height:h,borderRadius:4,overflow:"hidden",position:"relative",marginBottom:32}}>
    <div style={{position:"absolute",inset:0,backgroundImage:`url(${src})`,backgroundSize:"cover",backgroundPosition:pos}}/>
    <div style={{position:"absolute",inset:0,background:overlay||`linear-gradient(180deg, ${P.bg}22 0%, ${P.bg}BB 100%)`}}/>
  </div>;
}

function Section({id,num,title,sub,children,defaultCollapsed,art}){
  const ref=useRef(null); const[vis,setVis]=useState(false); const[collapsed,setCollapsed]=useState(!!defaultCollapsed);
  useEffect(()=>{const o=new IntersectionObserver(([e])=>{if(e.isIntersecting)setVis(true)},{threshold:0.05});if(ref.current)o.observe(ref.current);return()=>o.disconnect();},[]);
  useEffect(()=>{if(!defaultCollapsed)return;const onHash=()=>{if(window.location.hash==="#"+id)setCollapsed(false)};window.addEventListener("hashchange",onHash);onHash();return()=>window.removeEventListener("hashchange",onHash)},[id,defaultCollapsed]);
  return <section id={id} ref={ref} style={{padding:"80px 0",borderTop:`1px solid ${P.rule}`,opacity:vis?1:0,transform:vis?"translateY(0)":"translateY(24px)",transition:"opacity 0.7s ease, transform 0.7s ease",position:"relative",overflow:"hidden"}}>
    {art&&<div style={{position:"absolute",top:30,right:-80,opacity:0.3,pointerEvents:"none",transform:"scale(1.3)",transformOrigin:"top right"}}>{art}</div>}
    <div style={{position:"relative",marginBottom:defaultCollapsed?0:48,cursor:defaultCollapsed?"pointer":"default"}} onClick={defaultCollapsed?()=>setCollapsed(!collapsed):undefined}>
      <div style={{display:"flex",justifyContent:"space-between",alignItems:"flex-start"}}>
        <div style={{maxWidth:480}}>
          <span style={{fontFamily:F.mono,fontSize:SZ.mono,color:P.greenMid,letterSpacing:"0.1em",textTransform:"uppercase"}}>{num}</span>
          <h2 style={{fontFamily:F.display,fontSize:"clamp(28px,4vw,42px)",fontWeight:500,color:P.ink,margin:"8px 0 0",lineHeight:1.15}}>{title}</h2>
          {sub&&<p style={{fontFamily:F.body,fontSize:16,color:P.inkMuted,marginTop:12,lineHeight:SZ.lh}}>{sub}</p>}
        </div>
        {defaultCollapsed && <span style={{fontFamily:F.mono,fontSize:18,color:P.inkLight,marginTop:36,transform:collapsed?"rotate(0)":"rotate(45deg)",transition:"transform 0.2s"}}>+</span>}
      </div>
    </div>
    {(!defaultCollapsed || !collapsed) && <div style={{position:"relative",marginTop:defaultCollapsed?24:0}}>{children}</div>}
  </section>;
}

function Stat({n,l,c}){ return <div><div style={{fontFamily:F.display,fontSize:30,fontWeight:600,color:c||P.green}}>{n}</div><div style={{fontFamily:F.mono,fontSize:SZ.label,color:P.inkLight,letterSpacing:"0.06em",textTransform:"uppercase"}}>{l}</div></div>; }

